INSERT INTO `sys_oper_log` VALUES (746, '', 2, 'com.iams.manage.controller.DocumentController.updateDirectoryFiles()', 'PUT', 1, 'admin', '', '/manage/document/extraInfo', '127.0.0.1', 'IP', '{\"id\":14,\"label\":\"\",\"value\":\"<p>Can Language Models Serve as Text-Based World Simulators?</p>\"}', '{\"msg\":\"\",\"code\":200}', 0, NULL, '2025-04-14 11:50:07', 22);
INSERT INTO `sys_oper_log` VALUES (747, '', 2, 'com.iams.manage.controller.DocumentController.updateDirectoryFiles()', 'PUT', 1, 'admin', '', '/manage/document/extraInfo', '127.0.0.1', 'IP', '{\"id\":14,\"label\":\"\",\"value\":\"<p>Abstract\\nVirtual environments play a key role in bench-\\nmarking advances in complex planning and\\ndecision-making tasks but are expensive and\\ncomplicated to build by hand. Can current\\nlanguage models themselves serve as world\\nsimulators, correctly predicting how actions\\nchange different world states, thus bypassing\\nthe need for extensive manual coding? Our\\ngoal is to answer this question in the context\\nof text-based simulators. Our approach is to\\nbuild and use a new benchmark, called BYTE-\\nSIZED32-State-Prediction, containing a dataset\\nof text game state transitions and accompany-\\ning game tasks. We use this to directly quantify.\\nfor the first time, how well LLMs can serve as\\ntext-based world simulators. We test GPT-4 on\\nthis dataset and find that, despite its impressive\\nperformance, it is still an unreliable world sim-\\nulator without further innovations. This work\\nthus contributes both new insights into current\\nLLM\'s capabilities and weaknesses, as well as\\na novel benchmark to track future progress as\\nnew models appear.</p>\"}', '{\"msg\":\"\",\"code\":200}', 0, NULL, '2025-04-14 11:50:25', 16);
