-- ----------------------------
-- Triggers structure for table iot_visitor_application
-- ----------------------------
DROP TRIGGER IF EXISTS `update_stay_time`;
delimiter ;;
CREATE TRIGGER `update_stay_time` BEFORE INSERT ON `iot_visitor_application` FOR EACH ROW BEGIN
  IF NEW.entry_time IS NOT NULL AND NEW.exit_time IS NOT NULL THEN
    SET NEW.stay_time = TIMESTAMPDIFF(MINUTE, NEW.entry_time, NEW.exit_time);
  ELSE
    SET NEW.stay_time = NULL;
  END IF;
END
;;
delimiter ;

